export default (function(a,b,c,d,e,f){return {data:{GAZQFVngqC:{data:{id:433,attributes:{imdbId:"tt0388795",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTY5NTAzNTc1NF5BMl5BanBnXkFtZTYwNDY4MDc3._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.7\u002F10"},{Source:"Rotten Tomatoes",Value:"87%"},{Source:"Metacritic",Value:"87\u002F100"}],item_lang:{data:{id:1096,attributes:{title:c,plot:"Their acquaintance began on the warm summer of 1963, when cowboys, Ennis Del Mar and Jack Twist, ended up on the sheep farm of Joe Aguirre in Brokeback Mountain, Wyoming while looking for work. Under unexpected circumstances, little by little, the two men developed an intimate relationship that turned into a profound but secret bond, right under the nose of their families. However, love, and its many faces, is eternal. Who can stop love, life's ultimate truth?",slug:"brokeback-mountain"}}},books:{data:[{id:3528,attributes:{title:c,description:e,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=tO5UnwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:"2005-12-02",publisher:f,subtitle:"Now a Major Motion Picture"}},{id:3529,attributes:{title:c,description:e,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=DggeRs0uxM8C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:b,published:"2005-01-01",publisher:f,subtitle:d}},{id:3530,attributes:{title:"Close Range",description:"The title story in this collection of shorts now a film from Ang Lee.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=f-zI3bgDiCAC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:b,published:"2006-01-01",publisher:"HarperCollins UK",subtitle:"Brokeback Mountain and Other Stories"}},{id:3531,attributes:{title:"Brokeback Mountain: Story to Screenplay",description:"Annie Proulx has written some of the most original and brilliant short stories in contemporary literature, and for many readers and reviewers, Brokeback Mountain is her masterpiece. Brokeback Mountain was originally published in The New Yorker. It won the National Magazine Award. It also won an O. Henry Prize. Included in this volume is Annie Proulx's haunting story about the difficult, dangerous love affair between a ranch hand and a rodeo cowboy. Also included is the celebrated screenplay for the major motion picture \"Brokeback Mountain,\" written by Larry McMurtry and Diana Ossana. All three writers have contributed essays on the process of adapting this critically acclaimed story for film.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=kvyKvgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a,"Larry McMurtry","Diana Ossana"],firstBook:b,published:"2005-12-27",publisher:"Scribner",subtitle:d}},{id:3532,attributes:{title:"Brokeback Mountain (Flash Relatos)",description:"Annie Proulx, ganadora del premio Pulitzer, nos narra esta estremecedora historia de amor entre dos vaqueros, una historia capaz de sobrevivir a todo excepto a la salvaje intolerancia del mundo que los rodea. Ennis del Mar y Jack Twist son dos rancheros que se conocen cuando aceptan un trabajo para apacentar juntos un rebaño por encima de la zona arbolada en Brokeback Mountain. Ese verano surgirá entre ellos una intensa historia de amor.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=XfW_vNVqZWIC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:b,published:"2012-05-31",publisher:"FLASH",subtitle:d}}]}}},meta:{}}},prerenderedAt:1680940932301}}("Annie Proulx",null,"Brokeback Mountain","","The friendship between Ennis del Mar and Jack Twist, two cowboys, evolves into an intimate relationship while they are working together as a herder and camp tender, sharing a bond that spans many years and frequent separations.","Simon and Schuster"))